import React, { useState, useEffect } from 'react';
import { Container, Table, Alert, Spinner } from 'react-bootstrap';
import { consultaService } from '../services/api';

const Consultas = () => {
  const [consultas, setConsultas] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    carregarConsultas();
  }, []);

  const carregarConsultas = async () => {
    try {
      setLoading(true);
      const response = await consultaService.listar();
      setConsultas(response.data);
      setError('');
    } catch (err) {
      setError('Erro ao carregar consultas. Verifique se o servidor estÃ¡ rodando.');
      console.error('Erro:', err);
    } finally {
      setLoading(false);
    }
  };

  const formatarData = (dataString) => {
    return new Date(dataString).toLocaleDateString('pt-BR');
  };

  const formatarHora = (horaString) => {
    return horaString?.substring(0, 5);
  };

  if (loading) {
    return (
      <Container className="my-4">
        <div className="loading">
          <Spinner animation="border" role="status" className="me-2" />
          Carregando consultas...
        </div>
      </Container>
    );
  }

  return (
    <Container className="my-4">
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h2>ðŸ“… Consultas Agendadas</h2>
        <button className="btn btn-success" onClick={carregarConsultas}>
          ðŸ”„ Atualizar
        </button>
      </div>

      {error && <Alert variant="danger">{error}</Alert>}

      {consultas.length === 0 && !error ? (
        <Alert variant="info">
          Nenhuma consulta encontrada. 
          <br />
          <small>Verifique se hÃ¡ dados no banco ou se o backend estÃ¡ configurado corretamente.</small>
        </Alert>
      ) : (
        <div className="table-responsive">
          <Table striped bordered hover>
            <thead className="table-dark">
              <tr>
                <th>Data</th>
                <th>Hora</th>
                <th>Paciente</th>
                <th>MÃ©dico</th>
                <th>Status</th>
                <th>Valor</th>
              </tr>
            </thead>
            <tbody>
              {consultas.map(consulta => (
                <tr key={consulta.id}>
                  <td>{formatarData(consulta.data_consulta)}</td>
                  <td>{formatarHora(consulta.hora_consulta)}</td>
                  <td>{consulta.paciente?.nome || 'N/A'}</td>
                  <td>{consulta.medico?.nome || 'N/A'}</td>
                  <td>
                    <span className={`status ${consulta.status}`}>
                      {consulta.status}
                    </span>
                  </td>
                  <td>R$ {consulta.valor_consulta}</td>
                </tr>
              ))}
            </tbody>
          </Table>
        </div>
      )}
    </Container>
  );
};

export default Consultas;
